angular.module('registration-module',['ui.bootstrap','bootstrap-modal','bootstrap-growl','block-ui','session-module']).factory('form', function($compile,$timeout,$http,bootstrapModal,growl,bui,session) {
	
	function form() {
		
		function getAge(dateString) {
			var today = new Date();
			var birthDate = new Date(dateString);
			var age = today.getFullYear() - birthDate.getFullYear();
			var m = today.getMonth() - birthDate.getMonth();
			if (m < 0 || (m === 0 && today.getDate() < birthDate.getDate())) {
				age--;
			}
			return age;
		};
		
		Object.size = function(obj) {
			var size = 0, key;
			for (key in obj) {
				if (obj.hasOwnProperty(key)) size++;
			}
			return size;
		};		
		
		var self = this;
		
		var loading = '<div class="col-sm-offset-4 col-sm-8"><button type="button" class="btn btn-inverse" title="Loading" disabled><i class="fa fa-spin fa-refresh"></i>&nbsp; Please wait...</button></div>';
		
		self.data = function(scope) { // initialize data	
		
			scope.controls = {
				ok: {
					btn: false,
					label: 'Save'
				},
				cancel: {
					btn: false,
					label: 'Cancel'
				},
			};			

			scope.personal_info = {};
			scope.personal_info.id = 0;

			scope.personal_infos = []; // list			
			
			$http({
				method: 'POST',
				url: 'api/suggestions/municipalities'
			}).then(function mySucces(response) {
				
				scope.municipalities = response.data;
				scope.barangays = [];
				
			},function myError(response) {
				
			});
			
			/* $http({
				method: 'POST',
				url: 'api/suggestions/barangays'
			}).then(function mySucces(response) {
				
				scope.barangays = response.data;
				
			},function myError(response) {
				
			});	 */
			
			/*
			** Fetch active event
			*/
			$http({
			  method: 'POST',
			  url: 'handlers/active-event.php'
			}).then(function mySucces(response) {
				
				scope.activeEvent = response.data;
				
			}, function myError(response) {
				 
			  // error

			});
			
			scope.profileSuggestions = [];
			profiles(scope);
			
			scope.currentPage = 0;

		};

		function validate(scope) {
			
			var controls = scope.formHolder.personal_info.$$controls;
			
			angular.forEach(controls,function(elem,i) {
				
				if (elem.$$attr.$attr.required) elem.$touched = elem.$invalid;
									
			});

			return scope.formHolder.personal_info.$invalid;
			
		};
		
		function mode(scope,row) {
			
			if (row == null) {
				scope.controls.ok.label = 'Save';
				scope.controls.ok.btn = false;
				scope.controls.cancel.label = 'Cancel';
				scope.controls.cancel.btn = false;
				scope.views.list = true;
				
				scope.profileSuggestions = [];
			} else {			
				scope.controls.ok.label = 'Update';
				scope.controls.ok.btn = true;
				scope.controls.cancel.label = 'Close';
				scope.controls.cancel.btn = false;
				scope.views.list = false;			
			}
			
		};

		function profiles(scope) {
			
			/*
			**  Profile Suggestions
			*/
			$timeout(function() {
				$http({
				  method: 'POST',
				  url: 'api/suggestions/profiles'
				}).then(function mySucces(response) {
					
					scope.profileSuggestions = angular.copy(response.data);
					
				}, function myError(response) {
					 
				  // error
					
				});
			},200);				

		};
		
		function profile(scope,id) {
			
			scope.views.profile = "";			

			if (scope.$id > 2) scope = scope.$parent;

			$http({
			  method: 'POST',
			  url: 'handlers/registration-view.php',
			  data: {id: id}
			}).then(function mySucces(response) {
				
				angular.copy(response.data, scope.personal_info);
				scope.personal_info.birth_date = new Date(response.data.birth_date);
				
			}, function myError(response) {
				 
			  // error
				
			});			
			
		};
		
		function profileAdd(scope) {
			
			scope.views.onAdd = true;
			scope.views.profile = "";
			
			scope.personal_info = {};
			scope.personal_info.id = 0;			
			scope.personal_info.attendance = false;
			scope.personal_info.family_head = false;
			scope.personal_info.event_id = scope.activeEvent.id;
			
			scope.personal_info.address_municipality = scope.activeEvent.municipality;
			scope.barangays = scope.activeEvent.municipality.barangays;			
			
			mode(scope,null);			
			
		};
		
		self.registration = function(scope,row) {
			
			session.check().then(function success(response) {

				registration(scope,row);

			}, function error(response) {
				
			});

		};
		
		function registration(scope,row) {				
			
			bui.show();
			
			if (Object.size(scope.activeEvent) == 0) {
				
				growl.show('btn btn-danger',{from: 'top', amount: 55},'No event is active, please activate one at Events page');
				return;
				
			};					
			
			mode(scope,row);
			
			$('#x_content').html(loading);
			$('#x_content').load('forms/registration.html',function() {
				$timeout(function() {
					$compile($('#x_content')[0])(scope);
					profiles(scope);
				},200);
			});
	
			if (row != null) {
				
				if (scope.$id > 2) scope = scope.$parent;
				
				scope.views.onAdd = false;
				
				$http({
				  method: 'POST',
				  url: 'handlers/registration-view.php',
				  data: {id: row.id}
				}).then(function mySucces(response) {
					
					angular.copy(response.data, scope.personal_info);
					scope.personal_info.birth_date = new Date(response.data.birth_date);
					scope.barangays = scope.activeEvent.municipality.barangays;					
					
					bui.hide();
					
				}, function myError(response) {
					 
					bui.hide();
					
				});
				
			} else { // add 							
				
				scope.views.onAdd = true;
				scope.views.profile = "";
			
				scope.personal_info = {};
				scope.personal_info.id = 0;			
				
				$http({
				  method: 'POST',
				  url: 'handlers/registration-new.php'
				}).then(function mySucces(response) {
					
					// angular.copy(response.data, scope.personal_info);
					scope.personal_info.id = response.data['id'];				
					
					scope.personal_info.attendance = false;
					scope.personal_info.family_head = false;
					scope.personal_info.event_id = scope.activeEvent.id;
					
					scope.personal_info.personal_info_no = "";									
					
					scope.personal_info.address_municipality = scope.activeEvent.municipality;
					scope.barangays = scope.activeEvent.municipality.barangays;	
					
					bui.hide();
					
				}, function myError(response) {
					 
					bui.hide();
					
				});
				
			}
			
		};
		
		
		self.edit = function(scope) {
			
			scope.controls.ok.btn = !scope.controls.ok.btn;
			
		};
		
		self.save = function(scope) {
			
			session.check().then(function success(response) {

				save(scope);

			}, function error(response) {
				
			});			
			
		};
		
		function save(scope) {
			
			if (validate(scope)) {
				growl.show('btn btn-danger',{from: 'top', amount: 55},'Please complete required fields');				
				return;
			}
			
			bui.show();
			
			$http({
			  method: 'POST',
			  url: 'handlers/registration-save.php',
			  data: {personal_info: scope.personal_info}
			}).then(function mySucces(response) {					

				if (scope.views.onAdd) {
					scope.views.onAdd = false;
					scope.personal_info.personal_info_no = response.data.personal_info_no;					
					growl.show('btn btn-success',{from: 'top', amount: 55},'New profile added');
				} else {
					growl.show('btn btn-success',{from: 'top', amount: 55},'Info updated successfully');
				}
				
				mode(scope,scope.personal_info);
				
				profiles(scope);
				
				bui.hide();
				
			}, function myError(response) {
				 
				bui.hide();
				
			});			
			
		};		
		
		self.delete = function(scope,row) {
			
		var onOk = function() {
			
			if (scope.$id > 2) scope = scope.$parent;			
			
			$http({
			  method: 'POST',
			  url: 'handlers/registration-delete.php',
			  data: {id: [row.id]}
			}).then(function mySucces(response) {

				self.list(scope);
				
			}, function myError(response) {
				 
			  // error
				
			});

		};

		bootstrapModal.confirm(scope,'Confirmation','Are you sure you want to delete this record?',onOk,function() {});
			
		};		

		self.list = function(scope) {

			scope.views.list = false;
			scope.views.profile = "";				
		
			scope.personal_info = {};
			scope.personal_info.id = 0;	
			
			/*
			** async
			*/
			$('#x_content').html(loading);
			$('#x_content').load('lists/registration-async.html', function() {
				
				$timeout(function() {
					$compile($('#x_content')[0])(scope);
				},100);
				
				$timeout(function() {
					var list = $('#personal').DataTable({
						"displayStart": scope.currentPage*10,
						"ordering": false,
						"processing": true,
						"serverSide": true,
						"ajax": "handlers/registration-list-async.php",
						"drawCallback": function(settings) {

							$timeout(function() {
								$compile($('#x_content #personal')[0])(scope);
							},200);
							
						    var api = this.api();
					 
							scope.currentPage = api.page();

						},
						"fnServerParams": function(aoData) {
							aoData['list_filters'] = {id:1};
						}
					});
					// scope.currentPage = list.page.info().page;
				},100);
				
			});			
			
		};
		
		self.barangaySelect = function($item, scope) {
			
			scope.personal_info.address_barangay = $item;
			
		};
		
		self.municipalitySelect = function($item, scope) {
			
			scope.personal_info.address_municipality = $item;
			scope.barangays = $item.barangays;
			
		};
		
		self.profileSelect = function($item, scope) {
			
			profile(scope,$item.id);
			
		};

		self.profileSelectList = function($item, scope) {

			self.registration(scope,{id: $item.id});

		};		

		self.print = function(scope,personal_info) {
			
			$http({
			  method: 'POST',
			  url: 'handlers/print-registration.php',
			  data: {id: personal_info.id}
			}).then(function mySucces(response) {
				
				print(scope,response.data);
				
			}, function myError(response) {
				 
			  // error
				
			});			
			
		};
		
		self.birthday = function(scope) {
			
			if (scope.personal_info.birth_date == null) return;
			scope.personal_info.age = getAge(scope.personal_info.birth_date); //for birthday autocompute

		};
		
		function print(scope,personal_info) {
			console.log(scope.personal_info);
			var imgData = 'data:image/png;base64,';
			var doc = new jsPDF("p", "mm", "letter");
			
			doc.addImage(imgData, 'JPEG', 70, 5, 80, 25);
			doc.setFontSize(14)
			doc.setFontType('italic');
			doc.setFont('default');
			doc.text(72, 32, 'I Love My Barangay Information Sheet');
			doc.setFontSize(12)
			doc.setFont('default');
			doc.setFontType('normal');
			doc.setFont('times');
			doc.text(20, 50, 'Family Name: ');
			doc.setFontType('bold');
			doc.text(90, 50, personal_info.lastname);
			doc.setFontType('normal');
			doc.text(20, 58, 'Given Name: ');
			doc.setFontType('bold');
			doc.text(90, 58, personal_info.firstname+' '+personal_info.extension_name);
			doc.setFontType('normal');
			doc.text(20, 66, 'Middle Name: ');
			doc.setFontType('bold');
			doc.text(90, 66, personal_info.middlename);
			doc.setFontType('normal');
			doc.text(20, 74, 'Civil Status: ');
			doc.setFontType('bold');
			doc.text(90, 74,personal_info.civil_status);
			doc.setFontType('normal');
			doc.text(20, 82, 'Head of the family? ');
			doc.setFontType('bold');
			doc.text(90, 82,personal_info.family_head);
			doc.setFontType('normal');
			doc.text(20, 90, 'How many members of the family? ');
			doc.setFontType('bold');
			doc.text(90, 90, ''+personal_info.family_members);
			doc.setFontType('normal');
			doc.text(20, 98, 'Gender: ');
			doc.setFontType('bold');
			doc.text(90, 98, personal_info.gender);
			doc.setFontType('normal');
			doc.text(20, 106, 'Age: ');
			doc.setFontType('bold');
			doc.text(90, 106, ''+personal_info.age);
			doc.setFontType('normal');
			doc.text(20, 114, 'Birthday: ');
			doc.setFontType('bold');
			doc.text(90, 114,personal_info.birth_date);
			doc.setFontType('normal');
			doc.text(20, 122, 'House Number: ');
			doc.setFontType('bold');
			doc.text(90, 122, ''+personal_info.address_house);
			doc.setFontType('normal');
			doc.text(20, 130, 'Purok: ');
			doc.setFontType('bold');
			doc.text(90, 130, ''+personal_info.address_purok);
			doc.setFontType('normal');
			doc.text(20, 138, 'Sitio: ');
			doc.setFontType('bold');
			doc.text(90, 138, personal_info.address_sitio);
			doc.setFontType('normal');
			doc.text(20, 146, 'Barangay: ');
			doc.setFontType('bold');
			doc.text(90, 146,personal_info.address_barangay);
			doc.setFontType('normal');
			doc.text(20, 154, 'Municipality: ');
			doc.setFontType('bold');
			doc.text(90, 154, personal_info.address_municipality);
			doc.setFontType('normal');
			doc.text(20, 162, 'Contact Number: ');
			doc.setFontType('bold');
			doc.text(90, 162, ''+personal_info.contact_no);
			doc.setFontType('normal');
			doc.text(20, 170, 'e-mail: ');
			doc.setFontType('bold');
			doc.text(90, 170, personal_info.contact_email);
			doc.setFontType('normal');
			doc.text(20, 178, 'Employment Status: ');
			doc.setFontType('bold');
			doc.text(90, 178, personal_info.employment_status);
			doc.setFontType('normal');
			doc.text(20, 186, 'Occupation: ');
			doc.setFontType('bold');
			doc.text(90, 186, personal_info.occupation);
			doc.setFontType('normal');
			doc.text(20, 194, 'Highest educational attainment: ');
			doc.setFontType('bold');
			doc.text(90, 194, personal_info.educational_attainment);
			doc.setFontType('normal');
			doc.text(20, 202, 'Philhealth member? ');			
			doc.setFontType('bold');
			doc.text(90, 202, personal_info.philhealth_member);			
			doc.setLineWidth(.1)
			doc.line(190,250,120,250)
			doc.text(150, 255, 'Signature');				
			
			var blob = doc.output('blob');
			window.open(URL.createObjectURL(blob));
			
		};
	};
	
	return new form();
	
});